#!/usr/bin/env python3
import sys


def solve(Q: int, S: "List[str]"):
    import collections
    d = collections.deque()
    for ss in S:
        if ss == "READ":
            print(d.pop())
        else:
            d.append(ss)
    return


# Generated by 2.11.0 https://github.com/kyuridenamida/atcoder-tools  (tips: You use the default template now. You can remove this line by using your custom template)
def main():
    def iterate_tokens():
        for line in sys.stdin:
            for word in line.split():
                yield word
    tokens = iterate_tokens()
    Q = int(next(tokens))  # type: int
    S = [next(tokens) for _ in range(Q)]  # type: "List[str]"
    solve(Q, S)

if __name__ == '__main__':
    main()
